function convertQvalMatVal($scoring_category, $qval){
	switch($scoring_category){
		case "A":
		case "D":
		case "E":
			$matval = $qval >= 5 ?  $qval/5 : 0;
		case "B":
		case "C":
			$matval = $qval;
		break;
	}
	return $matval;
}

function getMATscoreCAT($scoring_category, $value){
	// $value = convertQvalMatVal($scoring_category, $value);
	switch($scoring_category){
		case "A":
			if ($value <= 1) { 
				$bitvalue = 0; 
			} else if ($value <= 4) {
                $bitvalue = 1;
            }else if ($value <= 5) { 
            	$bitvalue = 2; 
            }else{
               	$bitvalue = 3;
            }
		break;

		case "B":
			if ($value <= 0){ 
				$bitvalue = 0; 
			}else if ($value <= 1) {
                $bitvalue = 1;
            }else if ($value <= 2) { 
            	$bitvalue = 2; 
            }else{
            	$bitvalue = 3;
            }
		break;

		case "C":
			$bitvalue = $value;
		break;

		case "D":
			if ($value <= 1) { 
				$bitvalue = 0; 
			}else if($value <= 4) {
               	$bitvalue = 1;
            }else{
              	$bitvalue = 2;
            }
		break;

		case "E":
			$bitvalue = $value <= 0 ? 0 : 1;
		break;	
	}

	return $bitvalue; //?
}

